        <section className="HomeHeader">
            <div className="HomeHeader-One">

                <Link className="button" onClick={LinkTo} >Zaloguj</Link>
                <Link className="button" to="/rejestracja">Załóż konto</Link>

            </div>
            <HomeHeader_Two />
        </section>
    )
}

export default HomeHeader
